看到第四集，速速来查陆直是谁演的。宁理大师级和白宇帆演技不错是意料之中，但一个小孩儿怎么也能把这种亦正亦邪的气质拿准的？善良和心机、机灵和老成、鲁莽与谨慎、大胆与害怕，都演得非常准确。人物的立体度也是一点点展开，人前招人喜欢又让人不设防、但实际上喜欢查探别人秘密、极善于察言观色拿捏人心、原本没有坏心思但为了活命是可以张口说谎甚至牺牲他人的，怎么这么会演！我对这个角色的兴趣甚至超越了曲三更仅次于宋典史！于垚你要是火了，可千万还是要踏实一点，别失了这份对表演的真诚啊！
